function headerLeft() {
  return (
      <>
    <div className="header-left">
      <div id="logo">
        <a href="{{ home }}">
          <img
            src="{{ logo }}"
            title="{{ name }}"
            alt="{{ name }}"
            class="img-responsive"
          />
        </a>
        <h1>
          <a href="{{ home }}">{{ name }}</a>
        </h1>
      </div>
    </div>
    <style jsx>{`
    .header-left {
	float: left;
	width: auto;
}
        `}</style>
    </>
  );
}
